function App() {
  const [state, setState] = useState({
    search: "",
    category: null
  });

  return (
    <BrowserRouter>


    <ProductsContext.Provider value={{ state, setState }}>
      <div className="App">
        <Header />
        <Search />
        <Routes>
<Route  path="/"/>
<Route  path=""/>

        </Routes>
        <Body />
      </div>
    </ProductsContext.Provider>
    </BrowserRouter>
  );
}

export default App;
